LyricParts.Lyrics:
All hail the power of Jesus name!
Let angels prostrate fall;
Bring forth the royal diadem,
And crown Him Lord of all;
Bring forth the royal diadem,
And crown Him Lord of all.

Long my imprisoned Spirit lay
Fast bound in sin and nature's night;
Thine eye diffused a quickening ray,
I woke, the dungeon flamed with light;
My chains fell off, my heart was free;
I rose, went forth and followed Thee.

Angels from the realms of glory,
Wing your flight o'er all the earth;
Ye who sang creation's story,
Now proclaim Messiah's birth.
Come and worship, come and worship;
Worship Christ, the newborn King!

Shepherds in the fields abiding,
Watching o'er your flocks by night;
God with man is now residing,
Yonder shines the infant Light.
Come and worship, come and worship;
Worship Christ, the newborn King!

Sages, leave your contemplations,
Brighter visions beam afar;
Seek the great Desire of nations,
Ye have seen His natal star.
Come and worship, come and worship;
Worship Christ, the newborn King!

Saints, before the altar bending,
Watching long in hope and fear;
Suddenly the Lord, descending,
In His temple shall appear.
Come and worship, come and worship;
Worship Christ, the newborn King!

All creation, join in praising,
God, the Father, Spirit, Son;
Evermore your voices raising,
To the eternal Three in One.
Come and worship, come and worship;
Worship Christ, the newborn King!

Now I've giv'n to Jesus ev'rything;
Now I gladly own Him as my King;
Now my raptured soul can only sing
Of Calvary.

Mercy there was great and grace was free;
Pardon there was multiplied to me;
There my burdened soul found liberty,
At Calvary.

Away in a manger no crib for a bed;
The little Lord Jesus lay down His sweet head.
The stars in the sky looked down where He lay;
The little Lord Jesus asleep on the hay.

The cattle are lowing the baby awakes;
But little Lord Jesus no crying He makes.
I love Thee, Lord Jesus, look down from the sky;
And stay by my cradle till morning is nigh.

Be near me, Lord Jesus, I ask Thee to stay;
Close by me forever and love me I pray.
Bless all the dear children in Thy tender care;
And take us to heaven to live with Thee there.

Mine eyes have seen the glory
Of the coming of the Lord;
He is trampling out the vintage
Where the grapes of wrath are stored;
He hath loosed the fateful lightning
Of His terrible swift sword;
His truth is marching on.

I have seen Him in the watchfires
Of a hundred circling camps;
They have builded Him an altar
In the evening dews and damps;
I can read His righteous sentence
By the dim and flaring lamps;
His day is marching on.

Hither to Thy love has blest me;
Thou hast bro't me to this place;
And I know Thy hand will bring me
Safely home by Thy good grace.
Jesus sought me when a stranger,
Wandering from the fold of God;
He, to rescue me from danger,
Bought me with His precious blood.

Even so Lord, quickly come
To Thy final harvest home;
Gather Thou Thy people in,
Free from sorrow, free from sin;
There forever purified,
In Thy presence to abide.
Come with all Thine angels come;
Raise the glorious harvest home.

Praise God, from whom all blessings flow;
Praise Him, all creatures here below;
Praise Him above, ye heavenly host.
Praise Father, Son and Holy Ghost.
Amen.

Come to this fountain so rich and sweet;
Cast Thy poor soul at the Savior's feet;
Plunge in today and be made complete.
Glory to His name!

Hark the glad celestial hymn;
Angel choirs above are raising.
Cherubim and seraphim,
In unceasing chorus praising;
Fill the heavens with sweet accord,
Holy, holy, holy Lord.

Earthly pleasures vainly call me;
I would be like Jesus;
Nothing worldly shall enthrall me;
I would be like Jesus.

I'd rather have Jesus than silver or gold;
I'd rather be His than have riches untold;
I'd rather have Jesus than houses or lands.
I'd rather be led by His nail-pierced hand.

I'd rather have Jesus than men's applause;
I'd rather be faithful to His dear cause;
I'd rather have Jesus than worldwide fame.
I'd rather be true to His holy name.

He's fairer than lilies of rarest bloom;
He's sweeter than honey from out the comb;
He's all that my hungering spirit needs.
I'd rather have Jesus and let Him lead.

Green pastures are before me,
Which yet I have not seen;
Bright skies will soon be o'er me,
Where darkest clouds have been.
My hope I cannot measure;
My path to life is free;
My Saviour has my treasure,
And He will walk with me.

Other refuge have I none;
Hangs my helpless soul on Thee.
Leave ah leave me not alone;
Still support and comfort me!
All my trust on Thee is stayed;
All my help from Thee I bring.
Cover my defenseless head,
With the shadow of Thy wing.

Thou O Christ art all I want;
More than all in Thee I find.
Raise the fallen cheer the faint,
Heal the sick and lead the blind.
Just and holy is Thy name;
I am all unrighteousness.
False and full of sin I am;
Thou art full of truth and grace.

Sinner, not for me alone
Did the Son of God atone;
Your debt, too, made His own
On the cruel tree.
Come to Him with all your sin;
Be as white as snow within;
Full salvation you may win
And rejoice with me.

Jesus paid it all, all to Him I owe;
Sin had left a crimson stain,
He washed it white as snow.

Great prophet of my God,
My tongue would bless Thy name;
By Thee the joyful news,
Of our salvation came;
The joyful news of sins forgiven,
Of hell subdued and peace with heaven.

Jesus, my great High Priest,
Offered His blood and died;
My guilty conscience seeks
No sacrifice beside;
His powerful blood did once atone,
And not it pleads before the throne.

My Saviour and my Lord,
My Conqueror and my King;
Thy scepter and Thy sword,
Thy reigning grace I sing;
Thine is the power behold I sit,
In willing bonds beneath Thy feet.

Now let my soul arise
And tread the tempter down;
My Captain leads me forth,
To conquest and a crown;
A feeble saint shall win the day,
Though death and hell obstruct the way.

Joyful, joyful, we adore Thee,
God of glory Lord of love;
Hearts unfold like flow'rs before Thee,
Opening to the sun above.
Melt the clouds of sin and sadness;
Drive the dark of doubt away;
Giver of immortal gladness,
Fill us with the light of day!

Lead on, O King Eternal,
We follow, not with fears;
For gladness breaks like morning
Where'er Thy face appears.
Thy cross is lifted o'er us;
We journey in its light.
The crown awaits the conquest;
Lead on, O God of might.

Love divine, all love excelling,
Joy of heav'n, to earth come down!
Fix in us Thy humble dwelling;
All Thy faithful mercies crown.
Jesus, Thou art all compassion;
Pure, unbounded love Thou art.
Visit us with Thy salvation;
Enter ev'ry trembling heart.

More about Jesus on His throne,
Riches in glory all His own;
More of His kingdom's sure increase;
More of His coming, Prince of Peace.

More more about Jesus;
More more about Jesus;
More of His saving fullness see,
More of His love who died for me.

More love O Christ to Thee;
More love to Thee,
More love to Thee!

He took my sins and my sorrows;
He made them His very own;
He bore the burden to Calvary,
And suffered and died alone.

My soul be on thy guard;
Ten thousand foes arise;
The hosts of sin are pressing hard
To draw you from the skies.

There let the way appear,
Steps unto heaven;
All that Thou sendest me,
In mercy given;
Angels to beckon me,

Nearer, my God, to Thee;
Nearer, my God, to Thee,
Nearer to Thee!

For my pardon, this I see;
Nothing but the blood of Jesus.
For my cleansing, this my plea;
Nothing but the blood of Jesus.

Oh! precious is the flow,
That makes me white as snow;
No other fount I know;
Nothing but the blood of Jesus.

O come, Desire of nations,
Bind all peoples in one heart and mind;
Bid envy, strife, and quarrels cease;
Fill all the world with heaven's peace.

Jesus! the name that charms our fears,
That bids our sorrows cease;
'Tis music in the sinner's ears;
'Tis life, and health, and peace.

He breaks the power of canceled sin;
He sets the prisoner free.
His blood can make the foulest clean;
His blood availed for me.

Now rest, my long divided heart;
Fixed on this blissful center; rest;
Nor ever from my Lord depart,
With Him of every good possessed.

O, ye heights of heaven adore Him,
Angel hosts; His praises sing;
Pow'rs, dominions, bow before Him
And extol our God and King;
Let no tongue on earth be silent,
Ev'ry voice in concert ring;
Evermore and evermore!

Only believe, only believe;
All things are possible, only believe;
Only believe, only believe;
All things are possible, only believe.

Jesus! I do now receive Him;
More than all in Him I find.
He hath granted me forgiveness;
I am His and He is mine.

Praise my soul, the King of heaven,
To His feet thy tribute bring;
Ransomed, healed, restored, forgiven,
Evermore His praises sing;
Alleluia! Alleluia!
Praise the everlasting King.

Praise the Lord ye heav'ns adore Him;
Praise Him angels in the height.
Sun and moon rejoice before Him;
Praise Him all ye stars of light.
Praise the Lord, for He hath spoken,
Worlds His mighty voice obeyed;
Laws which never shall be broken,
For their guidance He hath made.

Praise the Lord, for He is glorious;
Never shall His promise fail.
God hath made His saints victorious;
Sin and death shall not prevail.
Praise God of our salvation,
Host on high His pow'r proclaim;
Heav'n and earth and all creation,
Laud and magnify His name.

Praise the Lord! ye heav'ns, adore Him;
Praise Him, angels, in the height;
Sun and moon, rejoice before Him;
Praise Him, all ye stars of light.
Praise the Lord! for He hath spoken.
Worlds His mighty voice obeyed;
Laws which never shall be broken
For their guidance He hath made.

Praise the Lord! for He is glorious;
Never shall His promise fail;
God hath made His saints victorious;
Sin and death shall not prevail.
Praise the God of our salvation!
Hosts on high, His power proclaim;
Heaven, and earth and all creation,
Laud and magnify His name.

Worship, honor, glory, blessing,
Lord, we offer unto Thee;
Young and old, Thy praise expressing,
In glad homage bend the knee;
All the saints in heaven adore Thee;
We would bow before Thy throne.
As Thine angels serve before Thee,
So on earth Thy will be done.

Revive us again;
Fill each heart with Thy love;
May each soul be rekindled
With fire from above.

Nothing in my hand I bring,
Simply to Thy cross I cling;
Naked come to Thee for dress,
Helpless look to Thee for grace;
Foul I to the fountain fly,
Wash me Savior or I die.

Not the labor of my hands,
Can fulfill Thy law's demands;
Could my zeal no respite know,
Could my tears forever flow,
All for sin could not atone;
Thou must save and Thou alone.

Could my tears forever flow?
Could my zeal no languor know?
These for sin could not atone;
Thou must save, and Thou alone.
In my hand no price I bring;
Simply to thy cross I cling.

We are Thine; do Thou befriend us;
Be the Guardian of our way.
Keep Thy flock; from sin defend us;
Seek us when we go astray.
Blessed Jesus, blessed Jesus!
Hear thy children when they pray;
Blessed Jesus, blessed Jesus!
Hear Thy children when they pray.

Silent night, holy night,
All is calm, all is bright.
Round yon virgin mother and child;
Holy infant, so tender and mild,
Sleep in heavenly peace;
Sleep in heavenly peace.

Time is now fleeting;
The moments are passing,
Passing from you and from me.
Shadows are gathering;
Death's night is coming,
Coming for you and for me.

I cried, "Lord Jesus," and He spoke my name;
I saw His hands all bruised and torn;
I stooped to kiss away the marks of shame,
The shame for me that He had borne.

The Lord's my Shepherd I'll not want,
He makes me down to lie in pastures green;
He leadeth me the quiet waters by.

That name I fondly love to hear;
It never fails my heart to cheer;
It's music dries the falling tear.
Exalt the name of Jesus!

This is my Father's world,
And to my listening ears;
All nature sings and round me rings
The music of the spheres.
This is my Father's world;
I rest me in the thought
Of rocks and trees, of skies and seas;
His hand the wonders wrought.

This is my Father's world;
The birds their carols raise.
The morning light, the lily white,
Declare their Maker's praise;
This is my Father's world;
He shines in all that's fair;
In the rustling grass I hear Him pass,
He speaks to me everywhere.

'Tis so sweet to trust in Jesus,
Just to take Him at His word;
Just to rest upon His promise;
Just to know "Thus saith the Lord."

His word shall not fail you He promised;
Believe Him, and all will be well;
Then go to a world that is dying,
His perfect salvation to tell!

Christ has for sin atonement made;
What a wonderful Savior!
We are redeemed, the price is paid;
What a wonderful Savior!

I praise Him for the cleansing blood;
What a wonderful Savior!
That reconciled my soul to God;
What a wonderful Savior!

He cleansed my heart from all its sin;
What a wonderful Savior!
And now He reigns and rules therein;
What a wonderful Savior!

He gives me overcoming power;
What a wonderful Savior!
And triumph in each trying hour;
What a wonderful Savior!

To Him I've given all my heart;
What a wonderful Savior!
The world shall never share a part;
What a wonderful Savior!

He walks beside me in the way;
What a wonderful Savior!
And keeps me faithful day by day;
What a wonderful Savior!

When morning gilds the skies,
My heart awaking cries;
May Jesus Christ be praised!
Alike at work and prayer,
To Jesus I repair;
May Jesus Christ be praised!

Does sadness fill my mind?
A solace here I find;
May Jesus Christ be praised!
Or fades my earthly bliss?
My comfort still is this;
May Jesus Christ be praised!

Ye nations of mankind,
In this your concord find;
May Jesus Christ be praised!
Let all the earth around
Ring joyous with the sound;
May Jesus Christ be praised!

Sing, suns and stars of space,
Sing, ye that see His face;
May Jesus Christ be praised!
God's whole creation o'er,
For aye and evermore;
May Jesus Christ be praised!

Be this, while life is mine,
My canticle divine;
May Jesus Christ be praised!
Be this the eternal song
Thro' all the ages long;
May Jesus Christ be praised!

Salvation to God who sits on the throne,
Let all cry aloud and honor the Son;
The praises of Jesus the angels proclaim;
Fall down on their faces and worship the Lamb.

Silent night, holy night,
All is calm, all is bright.
Round yon virgin mother and child;
Holy infant, so tender and mild,
Sleep in heavenly peace;
Sleep in heavenly peace.
